<script>var __DATABRICKS_NOTEBOOK_MODEL = {"version":"NotebookV1","origId":226197,"name":"999_01_StudentProject_NetworkAnomalyDetection","language":"scala","commands":[{"version":"CommandV1","origId":226235,"guid":"d25f8899-580a-4abd-a0c8-734d89260eef","subtype":"command","commandType":"auto","position":1.0,"command":"%md\n\n# [SDS-2.2, Scalable Data Science](https://lamastex.github.io/scalable-data-science/sds/2/2/)","commandVersion":0,"state":"error","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":0,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"ae867545-cd6b-4139-bb70-9baceff81013"},{"version":"CommandV1","origId":226198,"guid":"1005403a-a5e7-4f70-98c9-f117de566c3f","subtype":"command","commandType":"auto","position":2.0,"command":"%md\n# Network anomaly detection \n\n## Student Project\n\nby [Victor Ingman](https://www.linkedin.com/in/ingman/) and [Kasper Ramström](https://www.linkedin.com/in/kramstrom/)\n\nThis project set out to build an automatic network anomaly detection system for networks. Network threats are a major and growing concern for enterprises and private consumers all over the world. On average it takes 191 days for a company to detect a threat and another 66 days to contain the threat ([Enhancing Threat Detection with Big Data and AI](https://www.youtube.com/watch?v=i8___3GdxlQ)). In addition to taking long time to detect and contain threats, they also involve a ton of manual labour that require security experts. Thus, it should be a big priority for businesses to find solutions that not prevent malicious intrusions but also find these malicious activities in a fast and automated way, so that they can be dealt with swiftly.\n\nAn example of the threats we're facing today is the [WannaCry ransomware](https://www.symantec.com/blogs/threat-intelligence/wannacry-ransomware-attack) which spread rapidly throughout the world during 2017 and caused major havoc for companies and privates consumers throughout, including [Akademiska Sjukhuset](https://www.svt.se/nyheter/lokalt/uppsala/sjukhusledningen-i-forstarkningslage-efter-virusangreppet) here in Uppsala.\n\n![Super cool WannaCry screenshot](https://upload.wikimedia.org/wikipedia/en/1/18/Wana_Decrypt0r_screenshot.png)\n\nWith better security systems and automated ways of detecting malicious behaviour, many of these attacks could be prevented.\n\nTo gain inspiration for our project and find out how others have developed similar systems we've used the book [Advanced Analytics with Spark](http://shop.oreilly.com/product/0636920056591.do) which uses [k-means](https://en.wikipedia.org/wiki/K-means_clustering) clustering.\n\n![Advanced Analytics with Spark book](https://covers.oreillystatic.com/images/0636920056591/lrg.jpg)\n\nIn the book, the authors cluster different kinds of network events with the hopes of separating abnormal behaviour in clusters different from other events. The data used in the book is the publicly available [KDD Cup 1999 Data](https://kdd.ics.uci.edu/databases/kddcup99/kddcup99.html), which is both quite dated and different from the data we've used, but it works well as a proof of concept for our project. The code accompanying the above mentioned book can be found at https://github.com/sryza/aas and for our project we've used a similar approach for clustering the data using k-means.\n\nBelow, we present the code for our project alongside with explanations for what we've done and how we've done it. This includes data collection, data visualization, clustering of data and possible improvements and future work.","commandVersion":1,"state":"finished","results":{"type":"raw","data":"","arguments":{}},"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":0,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"deb9536c-0435-4b83-b0bf-92a8ba68ecf0"},{"version":"CommandV1","origId":226199,"guid":"8ee74be0-1faa-406e-b40c-1b0c4092b91e","subtype":"command","commandType":"auto","position":3.0,"command":"//This allows easy embedding of publicly available information into any other notebook\n//Example usage:\n// displayHTML(frameIt(\"https://en.wikipedia.org/wiki/Latent_Dirichlet_allocation#Topics_in_LDA\",250))\ndef frameIt( u:String, h:Int ) : String = {\n      \"\"\"<iframe \n src=\"\"\"\"+ u+\"\"\"\"\n width=\"95%\" height=\"\"\"\" + h + \"\"\"\"\n sandbox>\n  <p>\n    <a href=\"https://en.wikipedia.org/wiki/Anomaly_detection\">\n      Fallback link for browsers that, unlikely, don't support frames\n    </a>\n  </p>\n</iframe>\"\"\"\n   }","commandVersion":1,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">frameIt: (u: String, h: Int)String\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[],"datasetInfos":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1519549488163,"submitTime":1519549488175,"finishTime":1519549490558,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread im device, which would perform normal internet activity, including streaming to different media devices, transferring files and web surfing. During this, another device would (the attacker) would perform malicious activity such as port scans and fingerprinting of the victim. Our hopes were that the malicious activities would stand out from the other traffic and would hopefully be detectable for our anomaly detection models.\n\nFrom the book [Network Security Through Analysis](http://shop.oreilly.com/product/0636920028444.do) we read about the tools [Wireshark](https://www.wireshark.org/) and [Nmap](https://nmap.org). For our project, we used Wireshark for collecting network data on the victim's computer and Nmap for performing malicious activity.\n\n![](https://covers.oreillystatic.com/images/0636920028444/lrg.jpg)","commandVersion":1,"state":"finished","results":{"type":"raw","data":"","arguments":{}},"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":0,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"84e4792c-ce5e-412d-ab41-2f6fa61ea4bc"},{"version":"CommandV1","origId":226202,"guid":"79767169-eeff-4ee0-9657-114b1db9bcdb","subtype":"command","commandType":"auto","position":6.0,"command":"%md\n\n# Data anonymization\n\nAs we collected data on our own private network and publish this notebook along with the data publicly, we decided to anonmyize our network data for privacy reasons. To do this, we followed the Databricks guide: https://databricks.com/blog/2017/02/13/anonymizing-datasets-at-scale-leveraging-databricks-interoperability.html\n\nBy using the package [Faker](https://faker.readthedocs.io/en/latest/index.html) we generated fake source IP's and destination IP's for our network traffic data and used this data for the remainder of the project. Since we didn't parse the packet details for our network traffic and since it can potentially include sensitive information about our connections, we decided to remove that data from the public dataset.","commandVersion":1,"state":"finished","results":{"type":"raw","data":"","arguments":{}},"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":0,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"7d1bf38b-1d3b-48ba-8012-1c58d7dac9d6"},{"version":"CommandV1","origId":226203,"guid":"b747d9b8-a207-40ae-840d-978f9d205bac","subtype":"command","commandType":"auto","position":7.0,"command":"displayHTML(frameIt(\"https://en.wikipedia.org/wiki/Data_anonymization\",500))","commandVersion":1,"state":"finished","results":{"type":"raw","data":"","arguments":{}},"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":0,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iP ":null,"error":null,"workflows":[],"startTime":1515094025104,"submitTime":1515094025088,"finishTime":1515094028640,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"4fd88379-7c6f-49fd-8889-449633be8985"},{"version":"CommandV1","origId":226205,"guid":"a462e4d3-ee62-486a-b4c0-7eb3647a50f6","subtype":"command","commandType":"auto","position":8.0,"command":"%py\n\nimport unicodecsv as csv\nfrom collections import defaultdict\nfrom faker import Factory\n\ndef anonymize_rows(rows):\n    \"\"\"\n    Rows is an iterable of dictionaries that contain name and\n    email fields that need to be anonymized.\n    \"\"\"\n    # Load faker\n    faker  = Factory.create()\n\n    # Create mappings of names, emails, social security numbers, and phone numbers to faked names & emails.\n    sources  = defaultdict(faker.ipv4)\n    destinations = defaultdict(faker.ipv4)\n\n    # Iterate over the rows from the file and yield anonymized rows.\n    for row in rows:\n        # Replace name and email fields with faked fields.\n        row[\"Source\"]  = sources[row[\"Source\"]]\n        row[\"Destination\"] = destinations[row[\"Destination\"]]\n\n        # Yield the row back to the caller\n        yield row\n    \ndef anonymize(source, target):\n    \"\"\"\n    The source argument is a path to a CSV file containing data to anonymize,\n    while target is a path to write the anonymized CSV data to.\n    \"\"\"\n    with open(source, 'rU') as f:\n        with open(target, 'w') as o:\n            # Use the DictReader to easily extract fields\n            reader = csv.DictReader(f)\n            writer = csv.DictWriter(o, reader.fieldnames)\n\n            # Read and anonymize data, writing to target file.\n            for row in anonymize_rows(reader):\n                writer.writerow(row)\n        \n# anonymize(\"path-to-dataset-to-be-anonymized\", \"path-to-output-file\")","commandVersion":1,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\"></div>","arguments":{},"addedWidgets":{},"removedWidgets":[],"datasetInfos":[]},"errorSummary":"<span class=\"ansired\">ImportError</span>: No module named unicodecsv","error":"<div class=\"ansiout\"><span class=\"ansired\">---------------------------------------------------------------------------</span>\n<span class=\"ansired\">ImportError</span>                               Traceback (most recent call last)\n<span class=\"ansigreen\">&lt;command-282855639684568&gt;</span> in <span class=\"ansicyan\">&lt;module&gt;</span><span class=\"ansiblue\">()</span>\n<span class=\"ansigreen\">      1</span> <span class=\"ansiyellow\"></span>\n<span class=\"ansigreen\">----&gt; 2</span><span class=\"ansiyellow\"> </span><span class=\"ansigreen\">import</span> unicodecsv <span class=\"ansigreen\">as</span> csv<span class=\"ansiyellow\"></span>\n<span class=\"ansigreen\">      3</span> <span class=\"ansigreen\">from</span> collections <span class=\"ansigreen\">import</span> defaultdict<span class=\"ansiyellow\"></span>\n<span class=\"ansigreen\">      4</span> <span class=\"ansigreen\">from</span> faker <span class=\"ansigreen\">import</span> Factory<span class=\"ansiyellow\"></span>\n<span class=\"ansigreen\">      5</span> <span class=\"ansiyellow\"></span>\n\n<span class=\"ansired\">ImportError</span>: No module named unicodecsv</div>","workflows":[],"startTime":1515094035275,"submitTime":1515094035256,"finishTime":1515094035708,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"cba0b148-d313-413a-9ce0-1b312775a490"},{"version":"CommandV1","origId":226206,"guid":"42ad97d1-5636-477a-a0e2-5c983df31176","subtype":"command","commandType":"auto","position":9.0,"command":"%md\n# Wireshark and Nmap\n\nWhat is it?\nhttps://www.wireshark.org/\n\nWireshark is a free and open source packet analyzer. It is used for network troubleshooting, analysis, software and communications protocol development, and education.\n\nOur setup consisted of two computers, one as victim and one as attacker.\n\n## Step by step\n- Opened up Wireshark on the victims computer as well as logging activity on the network\n    - For a guide on how to log network info with wireshark, see the following:\n    https://www.wireshark.org/docs/wsug_html_chunked/ChCapCapturingSection.html\n- Started a lot of transfers and streams on the victims computer\n    - Started a Chromecast stream of a workout video on Youtube to a TV on the network\n    - Streaming music to speakers on the network via Spotify Connect\n    - Sending large files via Apple Airdrop\n- The attacker started Nmap and started a port scan against the victim\n- The attacker did a thourough fingerprint of the victim, such as OS detection and software detection at the open ports, also with Nmap\n- We exported the victims wireshark log as CSV by doing the following:\n![](https://www.sunlabs.se/assets/sds/wireshark-export-csv.png)\n\nThe following image visualizes the network environment\n![](https://www.sunlabs.se/assets/sds/graph-network-collection.png)\n\nThe dotted lines shows network communications\nFilled lines shows local execution or communication between nodes\nLines with arrows shows directed communication\n\nAfter that was done, about 30 minutes later, we exported the data to CSV-format. The CSV was formatted as follows:\n\nNo | Time | Source | Destination | Protocol | Length | Info\n--- | --- | --- | --- | --- | --- | ---\n1 | 0.001237 | 10.0.0.66 | 10.0.0.1 | DNS | 54 | [Redacted]\n⫶ | ⫶ | ⫶ | ⫶ | ⫶ | ⫶ | ⫶\n\n## Description of collected data\n- **No** = The id of the packet captured, starts from 0.\n- **Time** = Number of seconds elapsed since the capture started\n- **Source** = The IP address of the sender of the packet\n- **Destination** = The IP address of the receiver of the packet\n- **Protocol** = The protocol of the packet\n- **Length** = Length of the packet\n- **Info** = Data that is sent with the packet, redacted for privacy and anonymity\n\nThat way we are able to visualize the data collected in the form of a directed graph network and use the number of times a packet is sent identified by unique (source, destination, protocol).","commandVersion":1,"state":"finished","results":{"type":"raw","data":"","arguments":{}},"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":0,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"39634c6e-7d84-45e3-a2c7-a94c45e3b290"},{"version":"CommandV1","origId":226207,"guid":"3f4407dd-e982-4907-90ed-30e37bb8e1ea","subtype":"command","commandType":"auto","position":9.5,"command":"%md\n\n# Download the network data\n\nThe data dump we collected is available for download at the following url\n\nhttp://sunlabs.se/assets/sds/anon_data.csv","commandVersion":0,"state": vide both the functionality of GraphX and extended functionality taking advantage of Spark DataFrames. This extended functionality includes motif finding, DataFrame-based serialization, and highly expressive graph queries.\n\nThe GraphFrames package is available from [Spark Packages](http://spark-packages.org/package/graphframes/graphframes).\n\nThis notebook demonstrates examples from the [GraphFrames User Guide](http://graphframes.github.io/user-guide.html).\n\n(Above GraphFrames explanation taken from Raazesh Sainudiin's course [Scalable Data Science](https://lamastex.github.io/scalable-data-science/))\n\nUsing GraphFrames we can also see the the relationship between vertices using motifs, filter graphs and find the in- and outdegrees of vertices.\n\nTo visualize our graph network we decided to use the package JavaScript visualization package [D3](https://d3js.org/) which allows for complex visualizations of graph networks and tons of other applications.","commandVersion":1,"state":"finished","results":{"type":"raw","data":"","arguments":{}},"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":0,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"1fa7ac0a-4153-457f-94d3-8874e3234a66"},{"version":"CommandV1","origId":226212,"guid":"703245d4-11e5-43e0-9a57-9183e0386eb1","subtype":"command","commandType":"auto","position":11.0,"command":"displayHTML(frameIt(\"https://d3js.org\",500))","commandVersion":1,"state":"finished","results":{"type":"raw","data":"","arguments":{}},"errorSummary":null,"error":null,"workf .v3.min.js\"><\/script>\n<script>\n\nvar graph = $graph;\n\nvar width = $width,\n    height = $height;\n\nvar color = d3.scale.category20();\n\nvar force = d3.layout.force()\n    .charge(-700)\n    .linkDistance(180)\n    .size([width, height]);\n\nvar svg = d3.select(\"#clicks-graph\").append(\"svg\")\n    .attr(\"width\", width)\n    .attr(\"height\", height);\n    \nforce\n    .nodes(graph.nodes)\n    .links(graph.links)\n    .start();\n\nvar link = svg.selectAll(\".link\")\n    .data(graph.links)\n    .enter().append(\"line\")\n    .attr(\"class\", \"link\")\n    .style(\"stroke-width\", function(d) { return Math.sqrt(d.value); });\n\nvar node = svg.selectAll(\".node\")\n    .data(graph.nodes)\n    .enter().append(\"g\")\n    .attr(\"class\", \"node\")\n    .call(force.drag);\n\nnode.append(\"circle\")\n    .attr(\"r\", 10)\n    .style(\"fill\", function (d) {\n    if (d.name.startsWith(\"other\")) { return color(1); } else { return color(2); };\n})\n\nnode.append(\"text\")\n      .attr(\"dx\", 10)\n      .attr(\"dy\", \".35em\")\n      .text(function(d) { return d.name });\n      \n//Now we are giving the SVGs co-ordinates - the force layout is generating the co-ordinates which this code is using to update the attributes of the SVG elements\nforce.on(\"tick\", function () {\n    link.attr(\"x1\", function (d) {\n        return d.source.x;\n    })\n        .attr(\"y1\", function (d) {\n        return d.source.y;\n    })\n        .attr(\"x2\", function (d) {\n        return d.target.x;\n    })\n        .attr(\"y2\", function (d) {\n        return d.target.y;\n    });\n    d3.selectAll(\"circle\").attr(\"cx\", function (d) {\n        return d.x;\n    })\n        .attr(\"cy\", function (d) {\n        return d.y;\n    });\n    d3.selectAll(\"text\").attr(\"x\", function (d) {\n        return d.x;\n    })\n        .attr(\"y\", function (d) {\n        return d.y;\n    });\n});\n<\/script>\n</div>\n\"\"\")\n}\n  \n  def help() = {\ndisplayHTML(\"\"\"\n<p>\nProduces a f lidean distance (or other distance measures that don't work well for high dimensionality). Another possible solution could be to to use [dimensionality reduction](dimensionality reduction using autoencoder) and try to retain as much information as possible with fewer features. This could be done using techniques such as [PCA](https://en.wikipedia.org/wiki/Principal_component_analysis) or [LDA](https://en.wikipedia.org/wiki/Linear_discriminant_analysis).\n\n## Parse packet contents\n\nWe didn't parse the packet information other than IP addresses, packet lengths and protocol. To gain further insights one could parse the additional packet contents and look for sensitive items, including usernames, passwords etc.\n\n## Graph Analysis\n\nOne could continue analyze the graph representation of the data. Examples of this could include looking for comlpex relationships in the graph using GraphFrames motifs.\n\n## Real time network analysis using Spark streaming\n\nTo make the project even more useful in a real environment, one could use [Spark Streaming k-means](https://databricks.com/blog/2015/01/28/introducing-streaming-k-means-in-spark-1-2.html) to cluster network traffic in real time and then perform anomaly detection in real time as well. An example approach of this can be seen in the following video: https://www.youtube.com/watch?v=i8___3GdxlQ\n\nAdditional continuations of this could include giving suggestions for actions to perform when deteching malicious activity.","commandVersion":1,"state":"finished","results":{"type":"raw","data":"","arguments":{}},"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":0,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser"
